import styled from "styled-components";
import Logo from "../components/Logo";
import { Link } from "react-router-dom";
import Inputs from "../constants/Inputs";
import { useState } from "react";

export default function Login(){
    const [email,setEmail]=useState(" ");
    return (
        <>
            <Logo />
            <Wrapper>
                <Inputs type="text" placeholder={"email"} onChange={(e)=> setEmail(e.target.value)} />
                <Senha><Inputs type="text" placeholder={"senha"} onChange={(e)=>setEmail(e.target.value)} /></Senha>
                <Botão>Entrar</Botão>
                <Link to={`/cadastro`} >
                    <Cadastrar>Não tem uma conta? Cadastre-se!</Cadastrar>
                </Link>
            </Wrapper>
        </>
    )
}

//key={}
const Wrapper=styled.div`
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
`

const Senha= styled.div`
    color:#DBDBDB;
`
const Botão=styled.div`
	color: white;
	background: #52B6FF;
	border-radius: 5px;
    width: 303px;
    height: 45px;
    display: flex;
    align-items: center;
    justify-content: center;
    text-align: center;
`

const Cadastrar=styled.div`
    font-family: 'Lexend Deca';
    font-style: normal;
    font-weight: 400;
    font-size: 13.976px;
    line-height: 17px;
    text-align: center;
    text-decoration-line: underline;
    color: #52B6FF;
    margin-top: 30px;
`
